import { useDispatch } from 'react-redux';
import { addToCart } from '../features/cartSlice';
import './FoodCard.css';

const FoodCard = ({ food }) => {
  const dispatch = useDispatch();

  const safeImage = food.image || 'https://images.unsplash.com/photo/1568901346375-23c9450c58cd?w=400&h=250&fit=crop';

  return (
    <div className="food-card">
      <div className="tasty-badge">tasty!</div>
      <div className={`category-badge ${food.category === 'Non-Veg' ? 'non-veg' : 'veg'}`}>
        {food.category}
      </div>
      
      <div className="food-image-container">
        <img 
          src={safeImage}
          alt={food.name}
          className="food-image"
          onError={(e) => {
            e.target.src = 'https://images.unsplash.com/photo/1568901346375-23c9450c58cd?w=400&h=250&fit=crop';
          }}
        />
        <div className="image-overlay">
          <span>Popular</span>
        </div>
      </div>

      <div className="food-details">
        <h3 className="food-name">{food.name}</h3>
        <p className="food-desc">{food.description || 'Restaurant quality food'}</p>
        
        <div className="price-rating">
          <span className="food-price">â‚¹{food.price}</span>
          <div className="rating">
            <span className="stars">â˜…â˜…â˜…â˜…â˜…</span>
            <span className="rating-text">(4.8)</span>
          </div>
        </div>

        <button 
          className="add-btn"
          onClick={() => dispatch(addToCart(food))}
        >
          <span>ðŸ›’</span>
          <span>Add to Cart</span>
          <span>â‚¹{food.price}</span>
        </button>
      </div>
    </div>
  );
};

export default FoodCard;
